import React from "react";
import { Form, Input } from "antd";
const LoginForm = () => {
  return (
    <div>
      <Form>
        <div>
          <label htmlFor="user-id">아이디</label>
          <br>
          <Input name="user-id"/></br>
        </div>
        <div></div>
        <div></div>
      </Form>
    </div>
  );
};

export default LoginForm;
